import React from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

//componentes
import Index from "./components/students/Index";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/' component={Index} />
      </Switch>
    </Router>
  );
}

export default App;
